    { from: "Tim", to: "Keaton", message: "Hello", date: Date.now() },
    { from: "Mom", to: "keaton", message: "lets eat", date: Date.now() },
  ];

  return (
    <>
      <Container fluid>
        <Col></Col>
        <Col></Col>
      </Container>
    </>
  );
}
